webpackJsonp([0xeeaeea11ebe],{576:function(e,n){e.exports={data:{site:{siteMetadata:{title:"Academic Achievement Report SY 2016-2017",description:"",author:{name:"Tyler Collins"}}},markdownRemark:{html:"<h2>Act Aspire Results</h2>\n<h3>What is ACT Aspire?</h3>\n<ul>\n<li>ACT Aspire is an assessment system that measures academic achievement in English, math, reading, science, and writing in grades 3 through 10.</li>\n<li>ACT Aspire is linked to the ACT College and Career Readiness Standards, research-based information that makes test results meaningful by connecting a student’s ACT Aspire score to specific skills and knowledge important for college and work success.</li>\n<li>Teachers can use this information to address areas for improvement, build on strengths, and most importantly— impact students potentials.</li>\n</ul>\n<h3>ACT Aspire Readiness Levels</h3>\n<ul>\n<li>\n<p>In Need of Support</p>\n<ul>\n<li>Substantially below the ACT Readiness Benchmark</li>\n</ul>\n</li>\n<li>\n<p>Close</p>\n<ul>\n<li>Below but near the ACT Readiness Benchmark</li>\n</ul>\n</li>\n<li>\n<p>Ready</p>\n<ul>\n<li>Met the ACT Readiness Benchmark</li>\n<li>On target for College Readiness in Grade 11</li>\n</ul>\n</li>\n<li>\n<p>Exceeding</p>\n<ul>\n<li>Substantially above the ACT Readiness Benchmark</li>\n<li>Higher chance to be College and Career Ready</li>\n</ul>\n</li>\n</ul>\n<h3>Results Data</h3>",excerpt:"Act Aspire Results What is ACT Aspire? ACT Aspire is an assessment system that measures academic achievement in English, math, reading…",frontmatter:{title:"ActAspire"}}},pathContext:{slug:"/ActAspire/"}}}});
